var host = "http://web-api.int.testunited.minikube.local";


function getApiHost(){
    if(window.location.hostname === "localhost")
        return "http://web-api.int.testunited.minikube.local";
    else
        return host.replace("web-ui","web-api");
}

export default getApiHost;
